// Compatible with OpenZeppelin Contracts ^5.4.0
pragma solidity ^0.8.24;

import {ERC721} from "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import {ERC721URIStorage} from "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

//https://docs.openzeppelin.com/contracts/5.x/wizard WizardERC721NFT
//https://sepolia.etherscan.io/tx/0x98d74cc75eff4eaf9d5d092c6bfe05d36f6fb940c06d70f9e642253bf93cce1c 
//safemintURI"spacebear_1.json"https://sepolia.etherscan.io/token/0x6079c3db54aa663d068c4bf2dbb2036e15421259 tokenID0NFT
//tokenURIhttps://ethereum-blockchain-developer.com/2022-06-nft-truffle-hardhat-foundry/nftdata/spacebear_1.jsonNFT
//NFThttps://testnet.rarible.com/ NFT

//Spacebear ContractERC721, ERC721URIStorage, Ownable
contract Spacebear is ERC721, ERC721URIStorage, Ownable {
    //_nextTokenIdID
    uint256 private _nextTokenId;

    //initialOwner
    //initialOwner
    //initialOwnerSpacebearConstructorinitialOwner
    constructor(address initialOwner)
        ERC721("Spacebear", "SBR")
        Ownable(initialOwner)
    {}

    //_baseURINFTURI
    //URINFTURL
    function _baseURI() internal pure override returns (string memory) {
        return "https://ethereum-blockchain-developer.com/2022-06-nft-truffle-hardhat-foundry/nftdata/";
    }

    //safeMintNFTmint
    //toNFTuriNFTURL
    //onlyOwnerOwnerModifier
    //NFTIDuint256
    function safeMint(address to, string memory uri)
        public
        onlyOwner
        returns (uint256)
    {
        //_nextTokenId_nextTokenId
        // uint256 tokenId = ++_nextTokenId;_nextTokenIdtokenId
        uint256 tokenId = _nextTokenId++;
        //_safeMintNFTmintERC721
        //toNFTtokenIdNFTID
        //_safeMintERC721Receiver
        //_safeMint_mint
        _safeMint(to, tokenId);
        //_setTokenURINFTURLERC721URIStorage
        //tokenIdNFTIDuriNFTURL
        //URI_tokenURIs[i]="https://ethereum-blockchain-developer.com/2022-06-nft-truffle-hardhat-foundry/nftdata/i"
        _setTokenURI(tokenId, uri);
        return tokenId;
    }

    // The following functions are overrides required by Solidity.
    // ERC721URIStorageERC721
    //overrideERC721ERC721URIStorageERC721
    //ERC721tokenURIVirtual
    //overridetokenURIoverride
    //1. : ERC721ERC721URIStorage
    //2. : 
    //3. : tokenURI1ERC721URIStoragetokenURIoverride
    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        //overridesuper.
        return super.tokenURI(tokenId);
    }

    //
    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
